import React from 'react';
import './Header.scss';
import HorseImgFirst from '../files/pictures/favicon.svg';



export const Header = () => {
        return (
            <header>
                <img
                    src={HorseImgFirst}
                    height={40}
                    height={40}
                    alt="Logo"
                />
                <h3>Witamy na stronie stajni "DAR"</h3>
                <img
                    src={HorseImgFirst}
                    className="transform-img"
                    height={40}
                    height={40}
                    alt="Logo"
                />
                <nav>
                    <a>Strona główna</a>
                    <a>O stajni</a>
                    <a>Wydarzenia</a>
                    <a>Nasze konie</a>
                    <a>Oferta</a>
                    <a>Cennik</a>
                    <a>E-rezerwacje</a>
                    <a>Kontakt</a>
                </nav>
            </header>

        );
      }
